/**
 * Definition for singly-linked list.
 */
struct ListNode {
    int val;
    ListNode *next;
    ListNode(int x, ListNode* n = NULL) : val(x), next(n) {}
};
 
ostream& operator<<(ostream& os, ListNode* n)
{
    while (n) {
        os << n->val << " -> ";
        n = n->next;
    }
    return os;
}

// bottom-up mergesort, constant space
class Solution {
    public:
        ListNode *sortList(ListNode *head) {
            int n = 0;
            auto* p = head;
            while (p) { p = p->next; n++; }

            ListNode dummy {0};
            dummy.next = head;
            
            for (int l = 1; l < n; l *= 2) {
                auto* p1 = dummy.next, *p2 = p1, *f = &dummy;
                for (int i = 0; i < n - l; i += 2*l) {
                    int lo = i, hi = min(i + 2*l - 1, n-1), mi = (i+l-1);
                    //cout << "l " << l << ", lo " << lo << ", mi " << mi << ", hi " << hi << endl;

                    auto* tail1 = p1;
                    for (int j = lo; j < mi; j++) tail1 = tail1->next;

                    p2 = tail1->next; 
                    auto* tail2 = p2;
                    for (int j = mi+1; j <= hi; j++) tail2 = tail2->next;
                    //cout << "p2 " << p2 << ",  t2 " << tail2 << endl;

                    tail1->next = nullptr;
                    while (p1 && p2 != tail2) {
                        if (p1->val < p2->val) {
                            f->next = p1;
                            p1 = p1->next;
                        } else {
                            f->next = p2;
                            p2 = p2->next;
                        }
                        f = f->next;
                    }

                    if (p1) {
                        tail1->next = tail2;
                        f->next = p1;
                        //f->next = tail2;
                    } else f->next = p2;
                    while (f->next != tail2) f = f->next;
                    p1 = p2 = tail2;
                    //cout << "--- after: " << dummy.next << ", p1 " << p1 << endl;
                }
                //cout << "lv " << l << ": " << dummy.next << endl;
            }
            return dummy.next;
        }
};

// mergesort, but use O(lgN) stack space
class Solution2 {
    public:
        ListNode *sortList(ListNode *head) {
            int n = 0;
            auto* p = head;
            while (p) { p = p->next; n++; }

            ListNode* next = nullptr;
            return mergeSort(head, n, next);
        }

        ListNode *mergeSort(ListNode *head, int n, ListNode*& next) {
            if (n == 0) { return nullptr; }
            if (n == 1) { 
                auto* t = head->next;
                head->next = nullptr; 
                next = t;
                return head;
            }

            auto* l = mergeSort(head, (n+1)/2, next);
            auto* r = mergeSort(next, n - (n+1)/2, next);

            ListNode dummy {0};
            dummy.next = l;
            auto* t = &dummy;
            while (l && r) {
                if (l->val < r->val) {
                    t->next = l;
                    l = l->next;
                } else {
                    t->next = r;
                    r = r->next;
                }
                t = t->next;
            }

            if (!l) l = r;
            t->next = l;
            return dummy.next;
        }        
};

//quicksort (TLE)
class Solution3 {
    public:
        ListNode *sortList(ListNode *head) {
            if (!head || !head->next) return head;

            auto* p = partition(head);
            auto* l = sortList(head);
            auto* r = sortList(p);

            if (!l) return r;
            head = l;
            while (l->next) l = l->next;
            l->next = r;
            return head;
        }

        ListNode* partition(ListNode *& head) {
            ListNode dummy {INT_MIN};
            dummy.next = head;

            int pivot = head->val;
            auto* p = &dummy;
            auto* l = &dummy;
            while (p && p->next) {
                if (p->next->val < pivot) {
                    auto* t = p->next;
                    p->next = t->next;
                    t->next = l->next;
                    l->next = t;
                    l = t;
                } else p = p->next;
            }

            l = l->next;
            auto* t = l->next;
            l->next = nullptr;
            head = dummy.next; // restore head
            return t;
        }
};

