ListNode* build_list(int* v, int n)
{
    ListNode dummy {0};
    auto* p = &dummy;
    for (int i = 0; i < n; i++) {
        p->next = new ListNode{v[i]};
        p = p->next;
    }

    return dummy.next;
}

